import React, { Component } from "react";
import Project from "./project";

class Projects extends Component {
  state = {
    projectList: [
      (project = {
        uid: "0",
        shortname: "salespath"
      }),
      (project = {
        uid: "1",
        shortname: "grubhub"
      })
    ]
  };
  render() {
    return <Project />;
  }
}

export default Projects;
